import React from "react";
import styled from "styled-components";


class Group14013 extends React.Component {
  render() {
    const { className } = this.props;

    return (
      <Group13927 className={`group-13927 ${className || ""}`}>
        <OverlapGroup className="overlap-group-8">
          <Union className="union" src="/img/union@2x.svg" />
        </OverlapGroup>
        <CRIMINALJUSTICEPOLICEACCOUNTABILTYP
          className="criminal-justic-ntabiltyproject-2"
          src="/img/criminal-justice---police-accountabilty-project-1@2x.svg"
        />
      </Group13927>
    );
  }
}

const Group13927 = styled.div`
  height: 104px;
  align-self: center;
  margin-bottom: 11.99px;
  display: flex;
  align-items: flex-start;
  min-width: 425px;
`;

const OverlapGroup = styled.div`
  height: 107px;
  margin-left: -2px;
  margin-top: -1.55px;
  display: flex;
  padding: 37.6px 33.4px;
  align-items: flex-end;
  min-width: 157px;
  background-image: url(/img/vector-22@2x.svg);
  background-size: 100% 100%;
`;

const Union = styled.img`
  width: 28px;
  height: 15px;
`;

const CRIMINALJUSTICEPOLICEACCOUNTABILTYP = styled.img`
  width: 261px;
  height: 75px;
  align-self: center;
  margin-left: 9px;
  margin-top: 2.65px;
`;

export default Group14013;
